css:
atom-text-editor.editor .relative.current-line {
  color: #6494ed;
}
atom-text-editor.editor .absolute {
  display: none;
}
atom-text-editor.editor .gutter[gutter-name='relative-numbers'] {
  display: none;
}
atom-text-editor.vim-mode.insert-mode.editor .show-absolute-insert-mode .absolute,
atom-text-editor.vim-mode-plus.insert-mode.editor .show-absolute-insert-mode .absolute {
  display: inline;
}
atom-text-editor.vim-mode.insert-mode.editor .show-absolute-insert-mode .relative,
atom-text-editor.vim-mode-plus.insert-mode.editor .show-absolute-insert-mode .relative {
  display: none;
}
atom-text-editor.editor .show-absolute .absolute {
  display: inline;
  margin-right: 1em;
  color: rgba(99, 109, 131, 0.5);
}
atom-text-editor.editor .show-absolute .relative {
  display: inline !important;
}
